  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;rntFuse high performance reconfigurable
  processors with emerging fault-tolerance &amp;amp; autonomous processing techniques
  for a 10-100x decrease in processing time.&lt;br /&gt;rntThis means more science
  experiments conducted per day &amp;amp; more thorough, timely analysis of captured
  data.&lt;br /&gt;rntAddresses the ability to quickly react &amp;amp; adapt processing
  or mission objectives in real-time, by combining autonomous agents with reconfigurable
  computing.&lt;br /&gt;rntEnables Autonomous On-board Processing for Sensor Systems
  (A-OPSS), via a tool-suite that generates a run-time system for sensor systems to
  autonomously detect changes in collected data &amp;amp; tune processing in a controlled
  manner to adapt to unforeseen events.&lt;br /&gt;rntDecadal Survey Missions: Primary
  - DESDynl, HyspIRI, GEO-CAPE; Secondary &amp;ndash; SMAP, SWOT&lt;br /&gt;rnt&amp;nbsp;&lt;/p&gt;rn\",\n\t\"license_title\":
